def adi_part5(n: int, X: List[List[int]], A: List[List[int]], B: List[List[int]]) -> List[List[int]]:
    return matrix_row_slice(
        matrix_elemwise_sub(
            X,
            matrix_elemwise_div(
                matrix_elemwise_mul(
                    matrix_row_slice(X, 1, n),
                    A
                ),
                matrix_row_slice(B, 0, n-1)
            )
        ),
        1,
        n
    )
